import React from 'react'
import {Navbar, Nav, NavItem,Brand,Button,NavDropdown,Form,FormControl} from 'react-bootstrap';
import Task from "./pages/task"
import Home from "./pages/Home" 
import NavbarLogin from "./Nav/NavbarLogin" 
import { BrowserRouter as Router, Switch, Route ,Link} from "react-router-dom";





const ComponentLogined = ()=>{
    return<div>
      <NavbarLogin/>
      
      <Router>
          <Route exact path="logined/" component={Home}/>
          <Route path="logined/task" component={Task}/>
      </Router>
    </div>;
}
export default ComponentLogined;
